const chaptersEl = document.getElementById("chapters");
const bossesEl = document.getElementById("bosses");
const detailEl = document.getElementById("detail");
const closeBtn = document.getElementById("closeDetail");

let activeChapterId = null;
let activeBossName = null;

function makeButton({ title, subtitle, onClick, isActive }) {
  const btn = document.createElement("button");
  btn.className = "item" + (isActive ? " active" : "");
  btn.type = "button";

  const t = document.createElement("div");
  t.className = "item__title";
  t.textContent = title;

  const s = document.createElement("div");
  s.className = "item__sub";
  s.textContent = subtitle || "";

  btn.appendChild(t);
  if (subtitle) btn.appendChild(s);

  btn.addEventListener("click", onClick);
  return btn;
}

function renderChapters() {
  chaptersEl.innerHTML = "";
  DATA.chapters.forEach((ch) => {
    chaptersEl.appendChild(makeButton({
      title: `${ch.title}`,
      subtitle: ch.subtitle,
      isActive: ch.id === activeChapterId,
      onClick: () => {
        activeChapterId = ch.id;
        activeBossName = null;
        renderChapters();
        renderBosses();
        clearDetail();
      }
    }));
  });
}

function renderBosses() {
  bossesEl.innerHTML = "";
  if (!activeChapterId) {
    bossesEl.innerHTML = '<p style="color: var(--muted); padding: 6px 2px;">Selecione um cap√≠tulo.</p>';
    return;
  }

  const ch = DATA.chapters.find((c) => c.id === activeChapterId);
  ch.bosses.forEach((b) => {
    bossesEl.appendChild(makeButton({
      title: b.name,
      subtitle: "Clique para ver detalhes",
      isActive: b.name === activeBossName,
      onClick: () => {
        // clique no mesmo boss fecha (toggle)
        if (activeBossName === b.name) {
          activeBossName = null;
          renderBosses();
          clearDetail();
          return;
        }
        activeBossName = b.name;
        renderBosses();
        renderDetail(ch, b);
      }
    }));
  });
}

function clearDetail() {
  detailEl.className = "detail empty";
  detailEl.innerHTML = "<p>Selecione um boss para ver a descri√ß√£o e as imagens.</p>";
}

function renderDetail(ch, b) {
  detailEl.className = "detail";
  detailEl.innerHTML = "";

  const badge = document.createElement("div");
  badge.className = "badge";
  badge.innerHTML = `<strong>${ch.title}</strong><span style="color: var(--muted); font-size: 12px;">${ch.subtitle}</span>`;
  detailEl.appendChild(badge);

  const h = document.createElement("h3");
  h.textContent = b.name;
  detailEl.appendChild(h);

  const p = document.createElement("p");
  p.textContent = b.desc;
  detailEl.appendChild(p);

  const imgs = document.createElement("div");
  imgs.className = "images";

  const fig1 = document.createElement("figure");
  fig1.innerHTML = `
    <img src="${ch.chapterImage}" alt="Imagem do cap√≠tulo" loading="lazy" />
    <figcaption>Imagem do cap√≠tulo (link embutido)</figcaption>
  `;
  imgs.appendChild(fig1);

  const fig2 = document.createElement("figure");
  fig2.innerHTML = `
    <img src="${b.bossImage}" alt="Imagem do boss" loading="lazy" />
    <figcaption>Imagem do boss (ilustrativa, link embutido)</figcaption>
  `;
  imgs.appendChild(fig2);

  detailEl.appendChild(imgs);
}

closeBtn.addEventListener("click", () => {
  activeBossName = null;
  renderBosses();
  clearDetail();
});

// Estado inicial
activeChapterId = 1;
renderChapters();
renderBosses();
clearDetail();
